import './index.css';
import{ employee } from './data.js'

let details=new employee;
function Profile() {
  return (
    <div className="profile">
      <img id="y" src={details.profileImg} alt='profileImg'/>
      <p className='name'>{details.name}</p>
      <h4>Location</h4>
      <p>{details.location}</p>
      <h4>Blood group</h4>
      <p>{details.bloodGroup}</p>
      <h4>Age</h4>
      <p>{details.age}</p>
    </div>
  );
}

export default Profile;
